// Export to CSV
// Helper function to properly escape CSV values
function escapeCSVValue(value) {
  if (value === null || value === undefined) return '';
  const stringValue = String(value);
  // If value contains comma, quote, or newline, wrap in quotes and escape internal quotes
  if (stringValue.includes(',') || stringValue.includes('"') || stringValue.includes('\n')) {
    return '"' + stringValue.replace(/"/g, '""') + '"';
  }
  return stringValue;
}

function exportToCSV(data, filename) {
  const headers = ['Model', 'Technology', 'VDS(max) [V]', 'ID(max) [A]', 'RDS(on) [mŒ©]', 'Package', 'Manufacturer', 'Applications'];

  let csvContent = headers.join(',') + '\n';

  data.forEach(transistor => {
    const row = [
      escapeCSVValue(transistor.model),
      escapeCSVValue(transistor.technology),
      transistor.vds_max,
      transistor.id_max,
      transistor.rds_mohm,
      escapeCSVValue(transistor.package),
      escapeCSVValue(transistor.manufacturer),
      escapeCSVValue(transistor.application)
    ];
    csvContent += row.join(',') + '\n';
  });

  downloadFile(csvContent, filename + '.csv', 'text/csv');
}

// Download file
function downloadFile(content, filename, mimeType) {
  const blob = new Blob([content], { type: mimeType });
  const url = window.URL.createObjectURL(blob);
  const a = document.createElement('a');
  a.href = url;
  a.download = filename;
  document.body.appendChild(a);
  a.click();
  document.body.removeChild(a);
  window.URL.revokeObjectURL(url);
}

