// Calculate driver losses - SCIENTIFIC FORMULAS with real driver parameters
// –ò–∑—á–∏—Å–ª–µ–Ω–∏–µ –Ω–∞ –∑–∞–≥—É–±–∏—Ç–µ –Ω–∞ –¥—Ä–∞–π–≤–µ—Ä–∞ - –ù–ê–£–ß–ù–ò –§–û–†–ú–£–õ–ò —Å —Ä–µ–∞–ª–Ω–∏ –ø–∞—Ä–∞–º–µ—Ç—Ä–∏ –Ω–∞ –¥—Ä–∞–π–≤–µ—Ä–∞
function calculateDriverLosses() {
  if (!selectedDriver) {
    alert(LANGUAGES[currentLang].selectDriverFirst || '–ú–æ–ª—è, –∏–∑–±–µ—Ä–µ—Ç–µ –¥—Ä–∞–π–≤–µ—Ä –∑–∞ –∏–∑—á–∏—Å–ª–µ–Ω–∏—è.');
    return;
  }
  
  // Get REAL working parameters from Calculator (localStorage)
  const workingParams = getWorkingParameters();
  const vddDriver = 15; // Typical gate driver supply voltage (V)
  const vdc = workingParams.vdc; // DC bus voltage (V)
  const iLoad = workingParams.current; // Load current (A)
  const fswDriver = workingParams.freq * 1000; // Convert kHz to Hz
  
  // Use REAL gate charge from transistor datasheet
  let qg_nC = 100; // Default fallback
  let vgsDriver = selectedDriver.vgs_out || 15; // Driver output voltage (V)
  
  if (selectedTransistor && selectedTransistor.qg_nc) {
    // Use real datasheet value
    qg_nC = selectedTransistor.qg_nc;
  } else if (selectedTransistor) {
    // Estimate Qg if not in transistor data (for transistors without datasheet params yet)
    const tech = selectedTransistor.name.includes('GaN') ? 'GaN' :
                 selectedTransistor.name.includes('SiC') ? 'SiC' : 'Si';
    const k = tech === 'GaN' ? 20 : tech === 'SiC' ? 70 : 150;
    qg_nC = k * (selectedTransistor.id_max / 10) * Math.sqrt(selectedTransistor.vds_max / 100);
    console.warn(`Using estimated Qg for ${selectedTransistor.name}: ${qg_nC.toFixed(1)}nC (no datasheet value)`);
  }
  
  // ===== GATE DRIVING POWER LOSSES =====
  // –§–æ—Ä–º—É–ª–∞: P_gate = Q_g √ó V_gs √ó f_sw √ó 2 (charge + discharge)
  // –û–±—è—Å–Ω–µ–Ω–∏–µ: –ï–Ω–µ—Ä–≥–∏—è—Ç–∞ –∑–∞ –∑–∞—Ä–µ–∂–¥–∞–Ω–µ –Ω–∞ gate capacitance –µ E = Q√óV
  // –ü—Ä–∏ –≤—Å–µ–∫–∏ —Ü–∏–∫—ä–ª –¥—Ä–∞–π–≤–µ—Ä—ä—Ç –∑–∞—Ä–µ–∂–¥–∞ (charging) –∏ —Ä–∞–∑—Ä–µ–∂–¥–∞ (discharging) gate-–∞
  // –ú–æ—â–Ω–æ—Å—Ç = –ï–Ω–µ—Ä–≥–∏—è √ó –ß–µ—Å—Ç–æ—Ç–∞
  const qg_C = qg_nC * 1e-9; // Convert nC to Coulombs
  const pGateDriving = qg_C * vgsDriver * fswDriver * 2; // Watts (√ó 2 for charge + discharge)
  
  // ===== GATE CHARGING/DISCHARGING TIME (–≤–ª–∏—è–µ –Ω–∞ switching losses) =====
  // –§–æ—Ä–º—É–ª–∞: t_charge = Q_g / I_source (—Å–µ–∫—É–Ω–¥–∏)
  // –û–±—è—Å–Ω–µ–Ω–∏–µ: –í—Ä–µ–º–µ—Ç–æ –∑–∞ –∑–∞—Ä–µ–∂–¥–∞–Ω–µ –∑–∞–≤–∏—Å–∏ –æ—Ç —Ç–æ–∫–∞ –∫–æ–π—Ç–æ –¥—Ä–∞–π–≤–µ—Ä—ä—Ç –º–æ–∂–µ –¥–∞ –¥–æ—Å—Ç–∞–≤—è
  // –ü–æ-—Å–∏–ª–µ–Ω –¥—Ä–∞–π–≤–µ—Ä (–ø–æ-–≥–æ–ª—è–º I_source) ‚Üí –ø–æ-–±—ä—Ä–∑–æ –∑–∞—Ä–µ–∂–¥–∞–Ω–µ ‚Üí –ø–æ-–º–∞–ª–∫–∏ switching –∑–∞–≥—É–±–∏
  const iSource = selectedDriver.i_source_max; // Driver source current (A)
  const iSink = selectedDriver.i_sink_max; // Driver sink current (A)
  
  const tCharge = qg_C / iSource; // Gate charging time (s)
  const tDischarge = qg_C / iSink; // Gate discharging time (s)
  
  // ===== DRIVER PROPAGATION DELAY LOSSES =====
  // –§–æ—Ä–º—É–ª–∞: t_total = t_rise_driver + t_fall_driver + t_delay
  // –û–±—è—Å–Ω–µ–Ω–∏–µ: –î—Ä–∞–π–≤–µ—Ä—ä—Ç –¥–æ–±–∞–≤—è —Å–æ–±—Å—Ç–≤–µ–Ω–æ –≤—Ä–µ–º–µ –∑–∞ –ø—Ä–µ–≤–∫–ª—é—á–≤–∞–Ω–µ
  // –ü–æ-–±–∞–≤–µ–Ω –¥—Ä–∞–π–≤–µ—Ä ‚Üí –ø–æ-–¥—ä–ª–≥–∏ switching –≤—Ä–µ–º–µ–Ω–∞ ‚Üí –ø–æ–≤–µ—á–µ overlap –∑–∞–≥—É–±–∏
  const tRiseDriver = selectedDriver.t_rise * 1e-9; // Convert ns to s
  const tFallDriver = selectedDriver.t_fall * 1e-9; // Convert ns to s
  const tDelayDriver = selectedDriver.t_delay * 1e-9; // Convert ns to s
  
  // ===== SWITCHING OVERLAP LOSSES (–ø–æ—Ä–∞–¥–∏ –¥—Ä–∞–π–≤–µ—Ä–∞) =====
  // –§–æ—Ä–º—É–ª–∞: P_overlap = 0.5 √ó V_dc √ó I_load √ó (t_rise + t_fall + t_charge + t_discharge) √ó f_sw
  // –û–±—è—Å–Ω–µ–Ω–∏–µ: –ü–æ –≤—Ä–µ–º–µ –Ω–∞ –ø—Ä–µ–≤–∫–ª—é—á–≤–∞–Ω–µ –∏–º–∞ –º–æ–º–µ–Ω—Ç –∫–æ–≥–∞—Ç–æ –∏ –Ω–∞–ø—Ä–µ–∂–µ–Ω–∏–µ—Ç–æ –∏ —Ç–æ–∫—ä—Ç —Å–∞ –Ω–µ–Ω—É–ª–µ–≤–∏
  // –¢–æ–≤–∞ —Å—ä–∑–¥–∞–≤–∞ instantaneous power dissipation
  // –†–∞–∑–ª–∏—á–Ω–∏—Ç–µ –¥—Ä–∞–π–≤–µ—Ä–∏ –∏–º–∞—Ç —Ä–∞–∑–ª–∏—á–Ω–∏ –≤—Ä–µ–º–µ–Ω–∞ ‚Üí —Ä–∞–∑–ª–∏—á–Ω–∏ overlap –∑–∞–≥—É–±–∏
  const tSwitchingTotal = tCharge + tDischarge + tRiseDriver + tFallDriver;
  const pSwitchingOverlap = 0.5 * vdc * iLoad * tSwitchingTotal * fswDriver; // Watts
  
  // ===== TOTAL DYNAMIC LOSSES =====
  // –î–∏–Ω–∞–º–∏—á–Ω–∏—Ç–µ –∑–∞–≥—É–±–∏ = Gate driving + Switching overlap
  const pDynamic = pGateDriving + pSwitchingOverlap; // Watts
  
  // ===== STATIC LOSSES (Quiescent current) =====
  // –§–æ—Ä–º—É–ª–∞: P_static = I_q √ó V_dd
  // –û–±—è—Å–Ω–µ–Ω–∏–µ: –î—Ä–∞–π–≤–µ—Ä—ä—Ç –∫–æ–Ω—Å—É–º–∏—Ä–∞ —Ç–æ–∫ –¥–æ—Ä–∏ –∫–æ–≥–∞—Ç–æ –Ω–µ –ø—Ä–µ–≤–∫–ª—é—á–≤–∞
  // –ü–æ-–µ—Ñ–µ–∫—Ç–∏–≤–µ–Ω –¥—Ä–∞–π–≤–µ—Ä –∏–º–∞ –ø–æ-–º–∞–ª—ä–∫ I_q
  const pStatic = (selectedDriver.iq * 1e-3) * vddDriver; // Watts
  
  // ===== TOTAL DRIVER LOSSES =====
  const pDriverTotal = pDynamic + pStatic;
  
  // Display results with detailed breakdown
  document.getElementById('driverDynamicLosses').textContent = `${pDynamic.toFixed(3)} W`;
  document.getElementById('driverStaticLosses').textContent = `${pStatic.toFixed(3)} W`;
  document.getElementById('driverTotalLosses').textContent = `${pDriverTotal.toFixed(3)} W`;
  
  // Store detailed calculations for educational display
  window.driverCalcDetails = {
    qg_nC: qg_nC,
    vgsDriver: vgsDriver,
    iSource: iSource,
    iSink: iSink,
    tCharge: tCharge * 1e9, // Convert back to ns for display
    tDischarge: tDischarge * 1e9,
    tRiseDriver: tRiseDriver * 1e9,
    tFallDriver: tFallDriver * 1e9,
    pGateDriving: pGateDriving,
    pSwitchingOverlap: pSwitchingOverlap,
    pDynamic: pDynamic,
    pStatic: pStatic,
    pDriverTotal: pDriverTotal
  };
  
  console.log('üìä Driver Loss Breakdown:', window.driverCalcDetails);
  
  // Populate detailed calculations table for educational purposes
  const detailsAvailable = document.getElementById('calc_qg');
  if (detailsAvailable) {
    document.getElementById('calc_qg').textContent = `${qg_nC.toFixed(1)} nC`;
    document.getElementById('calc_vgs').textContent = `${vgsDriver.toFixed(1)} V`;
    document.getElementById('calc_isource').textContent = `${iSource.toFixed(1)} A`;
    document.getElementById('calc_isink').textContent = `${iSink.toFixed(1)} A`;
    document.getElementById('calc_tcharge').textContent = `${(tCharge * 1e9).toFixed(2)} ns`;
    document.getElementById('calc_tdischarge').textContent = `${(tDischarge * 1e9).toFixed(2)} ns`;
    document.getElementById('calc_trise').textContent = `${selectedDriver.t_rise} ns`;
    document.getElementById('calc_tfall').textContent = `${selectedDriver.t_fall} ns`;
    document.getElementById('calc_pgate').textContent = `${pGateDriving.toFixed(4)} W`;
    document.getElementById('calc_poverlap').textContent = `${pSwitchingOverlap.toFixed(4)} W`;
  }
}

// Calculate combined losses (driver + transistor)
function calculateCombinedLosses() {
  if (!selectedDriver) {
    alert(LANGUAGES[currentLang].selectDriverFirst || '–ú–æ–ª—è, –∏–∑–±–µ—Ä–µ—Ç–µ –¥—Ä–∞–π–≤–µ—Ä.');
    return;
  }
  
  if (!selectedTransistor) {
    alert(LANGUAGES[currentLang].noTransistorSelected || '–ú–æ–ª—è, –∏–∑–±–µ—Ä–µ—Ç–µ —Ç—Ä–∞–Ω–∑–∏—Å—Ç–æ—Ä.');
    return;
  }
  
  calculateDriverLosses();
  
  // Get driver losses
  const pDriverTotal = parseFloat(document.getElementById('driverTotalLosses').textContent);
  
  // Get REAL working parameters from inputs
  const workingParams = getWorkingParameters();
  const vdc = workingParams.vdc;
  const iLoad = workingParams.current;
  const fsw = workingParams.freq * 1000; // Convert kHz to Hz
  const temp = workingParams.temp;
  const duty = 0.5; // Can be added as input later if needed
  
  // Conduction losses
  const rdsOn = selectedTransistor.rds_mohm * (1 + selectedTransistor.alpha * (temp - 25)) / 1000;
  const pCond = Math.pow(iLoad, 2) * rdsOn * duty;
  
  // Switching losses
  const tr = selectedTransistor.tr_ns * 1e-9;
  const tf = selectedTransistor.tf_ns * 1e-9;
  const pSw = 0.5 * vdc * iLoad * (tr + tf) * fsw * 2;
  
  const pTransistor = pCond + pSw;
  
  // Combined
  const pCombined = pDriverTotal + pTransistor;
  const pOut = vdc * iLoad * duty;
  const efficiencyCombined = (pOut / (pOut + pCombined)) * 100;
  
  // Display results
  document.getElementById('transistorLossesInDriver').textContent = `${pTransistor.toFixed(3)} W`;
  document.getElementById('combinedTotalLosses').textContent = `${pCombined.toFixed(3)} W`;
  document.getElementById('combinedEfficiency').textContent = `${efficiencyCombined.toFixed(2)}%`;
  
  document.getElementById('combinedResults').style.display = 'block';
  
  // Create pie chart
  createCombinedLossChart(pDriverTotal, pCond, pSw);
}

